import React from 'react'
import axios from 'axios'
import queryString from 'query-string';

class Itemdetails extends React.Component {
    constructor(props){
        super(props);
        this.state={
            error:null,
            isLoaded:false,
            list:[]
        }

    }

        componentDidMount(){
            let branchid = queryString.parse(this.props.location.search.branch_id)
            let cateid = queryString.parse(this.props.location.search.item_id)
            //console.log(params.branch)
    
            const URL='http://resto.com.my/api/pos/touch_order/item_lists?branch_id='+branchid+'&item_id='+cateid
            axios.get(URL, 
                {
                    headers: {
                        'x-api-key': 'Sdrops!23' ,
                       'Access-Control-Allow-Origin': '*',
                       crossdomain: true,
                       'Content-Type': null
    
                    } 
                 })
    
            .then(res=>{
                console.log(res.data.item_lists);
                this.setState({list:res.data.categories_lists})
            })
           
            .catch(error =>{
                console.log(error);
            })
    
           
            
        }
    
    render() {
     
         return (
             <div></div>
         )
    }
}
export default Itemdetails
